import React from "react";
import styles from "./MealItem.module.css";

function MealItem(props) {
  return (
    <div className={styles.card}>
      <div>
        <img src={props.img} />
      </div>
      <div>
        <h3>{props.name}</h3>
        <p>{props.discription}</p>
      </div>
    </div>
  );
}

export default MealItem;
